import React from "react";
import "./style.css";


function Header() {
  return (
    <>
   <div class="jumbotron jumbotron-fluid">
  <div class="container">
    <h1 class="display-4">Game of Thrones Directory</h1>
    <p class="lead"></p>
  </div>
</div>
    </>
  );
}

export default Header;
